import React , { useEffect } from 'react';

function Zoo () {
	
	const api = "https://zoo-animal-api.herokuapp.com/animals/rand/10";
	
	useEffect(()=>{
		fetch( api )
		.then( x => x.json() )
		.then( x => {
			var zoo = x[0];
			console.log( zoo );
		});
	},[]);
	
	return (
		<section className="zoo">
			<h2>Zoo</h2>
		</section>
	);
};


export default Zoo;
